function getPageData($url, $referer = 'https://www.vk.com')
{
    
    $ch = curl_init();
    curl_setopt($ch, CURLOPT_URL, $url);
    curl_setopt($ch, CURLOPT_POST, 1);
    //curl_setopt($ch, CURLOPT_POSTFIELDS,$vars);  //Post Fields
    curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
    curl_setopt($ch, CURLOPT_ENCODING , "");

    $headers = [
        'X-Apple-Tz: 0',
        'X-Apple-Store-Front: 143444,12',
        'Accept: text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8',
        'Accept-Encoding: gzip, deflate',
        'Accept-Language: en-EN,en;q=0.5',
        'Cache-Control: no-cache',
        'Content-Type: application/x-www-form-urlencoded; charset=utf-8'
        . '8',
        'Content-Length: 0',
        'Host: vk.com',
        'Referer: ' . $referer , //Referrer address
        'User-Agent: Mozilla/5.0 (X11; Ubuntu; Linux i686; rv:28.0) Gecko/20100101 Firefox/28.0',
        'X-MicrosoftAjax: Delta=true'
    ];

    curl_setopt($ch, CURLOPT_HTTPHEADER, $headers);

    $server_output = curl_exec ($ch);

    curl_close ($ch);
    
    return $server_output;
}


function getUserData($id, $parsefile)
{
    $urlPrefix = "https://vk.com";
    
    $userUrl = $urlPrefix . $id;



    $pageHTML = getPageData($userUrl);

    $crawler = new Crawler($pageHTML);

    
            
    if ($crawler->filter('title')->text() == "404 Not Found")
    {
        echo "user not found. \n";
        return;
    }
    if ($crawler->filter('h2')->filter('.page_name')->getNode(0) == null)
    {
        echo "user is blocked. \n";
        return;
    }
    
    $name = $crawler->filter('h2')->filter('.page_name')->text();
    echo "user name: $name ";


    $avatarLink = $crawler->filter('#profile_photo_link')->extract(['onclick']);
    if (!$avatarLink)
    {
        echo "user profile is closed. \n";
        return;
    }

    $parseResult = preg_match('/\{"temp":(\{.+\}), jumpTo/', $avatarLink[0], $avatarJSONString);


    //var_dump($avatarJSONString[1]);
    $avatarJSON = json_decode($avatarJSONString[1]);
    //var_dump($avatarJSON);
    //echo "=======\n",$avatarJSONString[1],"\n=========";

    if (!isset($avatarJSON->z_[0]))
    {
        echo "user have no avatar. \n";
        return;
    }
    $avatarURL = $avatarJSON->base . $avatarJSON->z_[0] . '.jpg';
//    var_dump($avatarURL);

    $shortInfo = $crawler->filter('#profile_short')->filter('div')->filter('.profile_info_row');
    //var_dump($shortInfo);
    $birthday = '';
    $currentCity = '';
    foreach ($shortInfo as $node)
    {
        $rowCrawler = new Crawler($node);

    //    var_dump($rowCrawler->filter('div')->filter('.labeled')->text());vk

        $label = $rowCrawler->filter('div')->filter('.label')->text();
        if ($label == 'Birthday:')
        {
            $birthday = $rowCrawler->filter('div')->filter('.labeled')->text();
        }
        if ($label == 'Current city:')
        {
            $currentCity = $rowCrawler->filter('div')->filter('.labeled')->text();
        }

    }
//    print ' birthday: '. $birthday;
//    print ' city: ' . $currentCity;


    $fullInfo = $crawler->filter('#profile_full')->filter('div')->filter('.profile_info_block');
    $fullInfoData = [];
    $languages = [];
    $aboutMe = '';
    foreach ($fullInfo as $node)
    {
        $rowCrawler = new Crawler($node);
        $block = $rowCrawler->filter('div')->filter('.profile_info_header_wrap')->filter('span')->text();
//        var_dump($block);
        
        $blockData = $rowCrawler->filter('div')->filter('.profile_info')->filter('div')->filter('.profile_info_row');
        foreach ($blockData as $dataNode)
        {
            $rowDataCrawler = new Crawler($dataNode);
            $fullInfoData[$block] = [$rowDataCrawler->filter('.label')->text() => $rowDataCrawler->filter('.labeled')->text()];
            if ($rowDataCrawler->filter('.label')->text() == "Languages:")
            {
                $languagesArray = explode(', ', $rowDataCrawler->filter('.labeled')->text());
                $languages = $rowDataCrawler->filter('.labeled')->text();
            }
            if ($rowDataCrawler->filter('.label')->text() == "About me:")
            {
                $aboutMe = $rowDataCrawler->filter('.labeled')->text();
            }
        }

    }

    $albumUrl = $crawler->filter('#profile_albums')->filter('div')->filter('.module_body')->filter('div')->filter('.page_album_row')->filter('a')->filter('.page_album_link')->extract(['href']);
//    var_dump($albumUrl[0]);

    if (!isset($albumUrl[0]))
    {
        echo "user have no albums. \n";
        return;
    } 
    $fullAlbumUrl = $urlPrefix . $albumUrl[0]; //1-st album
    

    $pageHTML = getPageData($fullAlbumUrl);


    $crawlerAlbum = new Crawler($pageHTML);

    $photosUrl = $crawlerAlbum->filter('#photos_container_photos')->filter('div')->filter('a')->extract(['href']);


    $photoUrl = $photosUrl[0];

    $fullPhotoUrl = $urlPrefix . $photoUrl;

    $photoPageHTML = getPageData($fullPhotoUrl);

    /* array of images */
    $imagesParse = [];
    preg_match_all( '/"z_src":"(.+)"/U', $photoPageHTML, $imagesParse);

    /* add photos url to array */
    if (!isset($imagesParse[1]))
    {
        preg_match_all( '/"y_src":"(.+)"/U', $photoPageHTML, $imagesParse);
        /* add small photos url to array */
        if (!isset($imagesParse[1]))
        {
            echo "user have no photos. \n";
            return;
        }
    } 
    $allPhotosUrl = $imagesParse[1];

    
    // put data to file
    $userData = [
        'id' => $id,
        'name' => $name,
        'avatar' => $avatarURL,
        'birthday' => $birthday,
        'city' => $currentCity,
//        'languages' => json_encode($languagesArray),
        'languages' => $languages,
        'about me' => $aboutMe,
        'photos' => json_encode($allPhotosUrl),
    ];
    fputcsv($parsefile, $userData);
    echo "it is ok. \n";
    return;
}


